import axios from "axios";
// const BASEURL = "https://finnhub.io/api/v1/stock/profile2?symbol=";
// const APIKEY = "&token=brffu2vrh5rf96nt3qkg";

const BASEURL = "https://www.alphavantage.co/query?function=TIME_SERIES_DAILY&symbol=";
const APIKEY = "&apikey=7WYQWLQBUMPFGGK2";

export default {
  search: function(query) {
    return axios.get(BASEURL + query + APIKEY);
  }
};
